/* Import Section - Start */

/* React Imports - Start */

import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { useState,useEffect } from 'react';
import profileService from '../../services/profile/ProfileService';
/* React Imports -End */

/* Import Section - End */



/* Function - Start */

const Profile = () => {
  const [empEmail, setEmpEmail] = useState("lendlsim333@jmangroup.com");
  const [firstLetter, setFirstLetter] = useState('');
  const[data, setData] = useState({});
  const [change,setChange] =useState(false);
  const [editEnabled, setEditEnabled] = useState(false);
  const [showSaveBtn, setShowSaveBtn] = useState(false);
  const [tempData,setTempData] = useState([]);

  const getprofile=()=>{
    profileService.getProfileData(empEmail).then((res)=>{
    setData(res.data[0])
    setTempData(res.data[0])
    setFirstLetter(res.data[0].firstname.charAt(0));
  }).catch((err)=>{
    console.log(err)
  })
    useEffect(() => {
       getprofile()       
    },[change])

    
/* Render View Return - Start */
  return (
    <>
            <div className='profile-container'>
                <div className='profile-details-container'>
                    <p className='profile-details-header'>Profile Info :)</p>
                    <div className='profile-details-innerdiv'>
                        <label><strong>Employee Id</strong></label>
                        {!editEnabled &&
                            <span>{data.empid}</span>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.empid} onChange={(e) => {
                                setTempData({...tempData,empid:e.currentTarget.value})
                            }}/>
                        }
                    </div>
                    <div className='profile-details-innerdiv'>
                        <label><strong>Email</strong></label>
                        {!editEnabled &&
                            <span>{data.email}</span>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.email} disabled/>
                        }
                    </div>
                    <div className='profile-details-innerdiv'>
                        <label><strong>Mobile Number</strong></label>
                        {!editEnabled &&
                            <span>{data.mobilenumber}</span>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.mobilenumber} onChange={(e) => {
                                setTempData({...tempData,mobilenumber:e.currentTarget.value})
                            }}/>
                        }
                    </div>
                    <div className='profile-details-innerdiv'>
                        <label><strong>Date of Birth</strong></label>
                        {!editEnabled &&
                            <span>{data.dob}</span>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.dob} onChange={(e) => {
                                setTempData({...tempData,dob:e.currentTarget.value})
                            }}/>
                        }
                    </div>
                    <div className='profile-details-innerdiv'>
                        <label><strong>Date of Joining</strong></label>
                        {!editEnabled &&
                            <span>{data.doj}</span>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.doj} onChange={(e) => {
                                setTempData({...tempData,doj:e.currentTarget.value})
                            }}/>
                        }
                    </div>
                    <div className='profile-details-innerdiv'>
                        <label><strong>Work Location</strong></label>
                        {!editEnabled &&
                            <span>{data.worklocation}</span>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.worklocation} onChange={(e) => {
                                setTempData({...tempData,worklocation:e.currentTarget.value})
                            }}/>
                        }
                    </div>
                    <div className='profile-details-innerdiv'>
                        <label><strong>Blood Group</strong></label>
                        {!editEnabled &&
                            <span>{data.bloodgroup}</span>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.bloodgroup} onChange={(e) => {
                                setTempData({...tempData,bloodgroup:e.currentTarget.value})
                            }}/>
                        }
                    </div>
                </div>
                <div className='profile-pic-container'>
                    {data.profileimage &&
                        <img className='profile-pic' src={data.profileimage}></img>
                    }
                    {!data.profileimage &&
                        <p className='profile-pic'>{firstLetter}</p>
                    }
                    <div className='profile-person-name'>
                        {!editEnabled &&
                            <h2 className='profile-pic-letter'>{data.firstname}</h2>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.firstname} onChange={(e) => {
                                setTempData({...tempData,firstname:e.currentTarget.value})
                            }}/>
                        }
                        &nbsp;&nbsp;
                        {!editEnabled &&
                            <h2>{data.lastname}</h2>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.lastname} onChange={(e) => {
                                setTempData({...tempData,lastname:e.currentTarget.value})
                            }}/>
                        }
                    </div>
                    <p className='profile-person-designation'>
                        {!editEnabled &&
                            <h2>{data.designation}</h2>
                        }
                        {editEnabled &&
                            <input type="text"  value={tempData.designation} onChange={(e) => {
                                setTempData({...tempData,designation:e.currentTarget.value})
                            }}/>
                        }
                    </p>
                    <div className='edit-btn'>
                    <button className='btn editBtn'
                        onClick={
                            ()=>{
                                setEditEnabled(!editEnabled);
                                setShowSaveBtn(!showSaveBtn);
                                if(editEnabled === true){
                                    console.log("edit true..")
                                    setTempData(data);
                                }
                            }
                        }
                    >{editEnabled === true ? 'Cancel' : 'Edit'}</button>
                    {showSaveBtn &&
                        <button className='btn saveBtn'
                            onClick={
                                ()=>{
                                    axios.put(`http://localhost:4000/profile/${empEmail}?`,{data : tempData})
                                    .then(()=>
                                    {
                                        setEditEnabled(false);
                                        setShowSaveBtn(false);
                                        setData(tempData);
                                        setChange(!change)
                                    })
                                    .catch((err)=>{
                                        console.log(err)
                                    })
                                }
                            }
                        >Save</button>
                    }
                    </div>
                </div>
            </div>
        </>
  )
                  }
/* Render View Return - End */
}



/* Function - End */

/* Export default functionName */
export default Profile;
